import React from "react";
import {
  Form,
  FormGroup,
  Input,
  Label,
  Button,
  Container,
  Row,
  Col,
} from "reactstrap";
import { useForm } from "react-hook-form";
import { yupResolver } from "@hookform/resolvers/yup";
import { useDispatch } from "react-redux";
import { registerUser } from "../Features/UserSlice";
import { useNavigate, Link } from "react-router-dom";
import * as yup from "yup";

const schema = yup.object().shape({
  name: yup.string().required("Name is required"),
  email: yup.string().email().required("Email is required"),
  password: yup
    .string()
    .min(6, "Password must be at least 6 characters")
    .required("Password is required"),
  age: yup
    .number()
    .positive("Age must be positive")
    .integer("Age must be an integer")
    .required("Age is required"),
  gender: yup
    .string()
    .oneOf(["male", "female", "other"], "Select a valid gender")
    .required("Gender is required"),
});

const Register = () => {
  const dispatch = useDispatch();
  const navigate = useNavigate();

  const {
    register,
    handleSubmit,
    formState: { errors },
  } = useForm({
    resolver: yupResolver(schema),
  });

  const onSubmit = async (data) => {
    try {
      await dispatch(registerUser(data));
      navigate("/dashboard");
    } catch (error) {
      console.log("Registration error:", error);
    }
  };

  return (
    <Container className="register-page py-5">

      <Row className="justify-content-center">
        <Col md={6}>
          <h2 className="mb-4 text-center">Create Account</h2>
          <Form onSubmit={handleSubmit(onSubmit)}>
            {/* Name Field */}
            <FormGroup>
              <Label className="text-danger fw-bold">Name</Label>
              <Input
                type="text"
                placeholder="Enter your full name"
                {...register("name")}
              />
              <p className="text-danger">{errors.name?.message}</p>
            </FormGroup>

            {/* Email Field */}
            <FormGroup>
              <Label className="text-danger fw-bold">Email</Label>
              <Input
                type="email"
                placeholder="Enter your email address"
                {...register("email")}
              />
              <p className="text-danger">{errors.email?.message}</p>
            </FormGroup>

            {/* Password Field */}
            <FormGroup>
              <Label className="text-danger fw-bold">Password</Label>
              <Input
                type="password"
                placeholder="Choose a secure password"
                {...register("password")}
              />
              <p className="text-danger">{errors.password?.message}</p>
            </FormGroup>

            {/* Age Field */}
            <FormGroup>
              <Label className="text-danger fw-bold">Age</Label>
              <Input
                type="number"
                placeholder="Enter your age"
                {...register("age")}
              />
              <p className="text-danger">{errors.age?.message}</p>
            </FormGroup>

            {/* Gender Field */}
            <FormGroup>
              <Label className="text-danger fw-bold">Gender</Label>
              <Input type="select" {...register("gender")}>
                <option value="">Select Gender</option>
                <option value="male">Male</option>
                <option value="female">Female</option>
                <option value="other">Other</option>
              </Input>
              <p className="text-danger">{errors.gender?.message}</p>
            </FormGroup>

            {/* Submit Button */}
            <Button color="success" type="submit" className="w-100">
              Register
            </Button>
          </Form>

          <p className="mt-3 text-center">
            Already have an account? <Link to="/login">Login here</Link>
          </p>
        </Col>
      </Row>
    </Container>
  );
};

export default Register;
